import React, { forwardRef } from "react";
import { useDispatch } from "react-redux";
import { incrementCell } from "../../../../../../redux/actions";

const IncrementCell = React.forwardRef({ id, value }, (ref) => {
   const dispatch = useDispatch();

   return <td onClick={() => dispatch(incrementCell(id, value))}>{value}</td>;
});

export default IncrementCell;
